import React from "react";

export default function Member({ members }) {
  return (
    <div>
      {members.map((member) => {
        return (
          <div className="row justify-content-center">
            <div className="col-md text-center" key={member.login}>
              {member.login}
            </div>
          </div>
        );
      })}
    </div>
  );
}
